import React, {useState} from 'react';

import TitleScreen from './TitleScreen.js';

function FlashMath(){
    const [rem, setRem] = useState(<TitleScreen changeRem={(game) => startGame(game)}/>);

    function startGame(game){
        setRem(game);
    }

    return (
        <>
            {rem}
        </>
    )
}

export default FlashMath;
